pragma solidity ^0.8.0;
import "../libraries/LibCrowdfundr.sol";
import "../libraries/LibDiamond.sol";
import "hardhat/console.sol";

contract MainFacet {
  function contribute() external payable {
    LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
    console.log("contribute() minAmount", ds.minAmount);
    console.log('contribute() value', msg.value);
    LibCrowdfundr._enforceMinAmount(msg.value);

    ds.contributionAmount += msg.value;
    ds.contributionPerUser[msg.sender] += msg.value;
  }

  function claim() external {
    LibDiamond.enforceIsContractOwner();

    // TODO : Enforce goal was reached
    bool hasReached = LibCrowdfundr._goalHasBeenReached();
    require(hasReached, "Main: goal hasnt been reached or set");

    payable(msg.sender).transfer(address(this).balance);
  }

  function getMinAmount1() external view returns (uint256) {
    LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
    return ds.minAmount;
  }
  function getMinAmount2() external view returns (uint256) {
    uint256 minAmountFromStorage = LibDiamond.getMinAmount();
    return minAmountFromStorage;
  }
  function getContributionAmount() external view returns (uint256) {
    LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
    return ds.contributionAmount;
  }
}
